import React from 'react';
import { Navigate } from 'react-router-dom';

const PrivateRoute = ({ children }) => {
    const token = localStorage.getItem('token');
    if (!!token) {
        return children;
    } else {
        return <Navigate to="/" />
    };
};

export default PrivateRoute;
